  false,\n\t\"url\": null,\n\t\"notes\": \"This shapefile denotes the location of
  399 underwater videos and photos taken between 3/18 - 3/28/2013 in Fish Bay and
  Coral Bay, St. John and the St. Thomas East End Reserve (STEER) in the U.S. Virgin
  Islands (USVI). These locations were used to assess the thematic accuracy a benthic
  habitat map for Fish Bay, Coral Bay, and the STEER. They were chosen using by randomly
  placing 25 points in each of the 14 detailed geomorphological structure class. No
  buffer from polygon edges was used. Classes occupying larger areas were often allocated
  more than 25 points.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
